import "./App.css";
import { BrowserRouter, Route, Routes, Router } from "react-router-dom";
import { Dashboard } from "./components/Dashboard/Dashboard";
import Auth from "./components/Auth/Auth";
import { PostContext } from "./components/Protectedroute/PostContext";
import { PostContextProvider } from "../Protectedroute/PostContext";
function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/login" element={<Auth authRoute="login"></Auth>}></Route>
        <Route
          path="/register"
          element={<Auth authRoute="Register"></Auth>}
        ></Route>
        <Route path="/Dashboard" element={<Dashboard></Dashboard>}></Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
